    "The level(1-4) of a share/upload link password's strength. For example, '3' means password must have at least 3 of the following: num, upper letter, lower letter and other symbols": "\uacf5\uc720/\uc5c5\ub85c\ub4dc \ub9c1\ud06c \uc554\ud638\uc758 \uac15\ub3c4 \uc218\uc900(1-4)\uc785\ub2c8\ub2e4. \uc608\ub97c \ub4e4\uba74 '3'\uc740 \ub2e4\uc74c \uc870\uac74 \uc911 \uc138\uac00\uc9c0 \uc694\uac74\uc744 \ub9cc\uc871\ud574\uc57c \ud55c\ub2e4\ub294 \uc758\ubbf8\uc785\ub2c8\ub2e4: \uc22b\uc790, \ub300\ubb38\uc790, \uc18c\ubb38\uc790, \uae30\ud0c0 \uae30\ud638 \ubb38\uc790.",
