    "Whether the notifications of collaboration such as sharing library or joining group should be sent to your mailbox.": "\ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uacf5\uc720\ud558\uac70\ub098 \uadf8\ub8f9 \ucc38\uc5ec \uac74\uc5d0 \ub300\ud55c \ud611\uc5c5 \uc54c\ub9bc\uc744 \uba54\uc77c\ud568\uc73c\ub85c \ubcf4\ub0c5\ub2c8\ub2e4.",
    "Wrong password": "\uc798\ubabb\ub41c \uc554\ud638\uc785\ub2c8\ub2e4",
    "You are not in any groups. Groups allow multiple people to collaborate on libraries. Groups you join will be listed here.": "\uc5b4\ub5a4 \uadf8\ub8f9\uc5d0\ub3c4 \uc18d\ud574\uc788\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uadf8\ub8f9\uc5d0 \uc788\ub294 \uc5ec\ub7ec \uc0ac\ub78c\uc774 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \ud568\uaed8 \ub2e4\ub8f0 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ucc38\uc5ec\ud55c \uadf8\ub8f9\uc774 \uc5ec\uae30\uc5d0 \ub098\ud0c0\ub0a9\ub2c8\ub2e4.",
    "You are not in any groups. Groups allow multiple people to collaborate on libraries. You can create a group by clicking the \"New Group\" button in the menu bar.": "\uc5b4\ub5a4 \uadf8\ub8f9\uc5d0\ub3c4 \uc18d\ud574 \uc788\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uadf8\ub8f9\uc5d0 \uc788\ub294 \uc5ec\ub7ec \uc0ac\ub78c\uc774 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \ud568\uaed8 \ub2e4\ub8f0 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uba54\ub274 \ud45c\uc2dc\uc904\uc5d0 \"\uc0c8 \uadf8\ub8f9\" \ub2e8\ucd94\ub97c \ub20c\ub7ec \uadf8\ub8f9\uc744 \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You can also add a user as a guest, who will not be allowed to create libraries and groups.": "\uc0ac\uc6a9\uc790\ub97c \ub77c\uc774\ube0c\ub7ec\ub9ac\uc640 \uadf8\ub8f9\uc744 \ub9cc\ub4e4 \uc218 \uc5c6\ub294 \uc190\ub2d8\uc73c\ub85c \ucd94\uac00\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You can create files quickly": "\ud30c\uc77c\uc744 \uac04\ub2e8\ud558\uac8c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4",
    "You can create libraries by clicking the \"New Library\" button above.": "\uc704\uc5d0 \uc788\ub294 \"\uc0c8 \ub77c\uc774\ube0c\ub7ec\ub9ac\" \ub2e8\ucd94\ub97c \ub20c\ub7ec \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You can use this field at login.": "\ub85c\uadf8\uc778\uc2dc \uc774 \uc785\ub825\ucc3d\uc744 \uc0ac\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You don't have any favorite items yet": "\uc544\uc9c1 \uc5b4\ub5a4 \ud56d\ubaa9\ub3c4 \uc990\uaca8\ucc3e\uae30 \ud45c\uc2dc\ud574\ub450\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4",
    "You don't have any share links": "\uacf5\uc720\ud55c \ub9c1\ud06c\uac00 \uc5c6\uc2b5\ub2c8\ub2e4",
    "You don't have any upload links": "\uc5c5\ub85c\ub4dc \ub9c1\ud06c\uac00 \uc5c6\uc2b5\ub2c8\ub2e4.",
    "You have an unsaved draft. Do you like to use it?": "\uc800\uc7a5\ud558\uc9c0 \uc54a\uc740 \ucd08\uc548\uc774 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \ucd08\uc548\uc744 \uc0ac\uc6a9\ud558\uc2dc\uaca0\uc2b5\ub2c8\uae4c?",
    "You have not accessed your files with any client (desktop or mobile) yet. Configure clients on your devices to access your data more comfortably.": "\uc544\uc9c1 \uc5b4\ub5a4 \ud074\ub77c\uc774\uc5b8\ud2b8(\ub370\uc2a4\ud06c\ud1b1, \ubaa8\ubc14\uc77c)\uc5d0\uc11c\ub3c4 \ud30c\uc77c\uc5d0 \uc811\uadfc\ud558\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \ub370\uc774\ud130\uc5d0 \uc880 \ub354 \ud3b8\ub9ac\ud558\uac8c \uc811\uadfc\ud558\ub824\uba74 \uc7a5\uce58\uc758 \ud074\ub77c\uc774\uc5b8\ud2b8\ub97c \uc124\uc815\ud558\uc138\uc694.",
    "You have not added any libraries, folders or files to your favorites yet. A favorite gives you quick access to your most frequently used objects. You can add a library, folder or file to your favorites by clicking the star to the left of its name.": "\uc544\uc9c1 \uc5b4\ub5a4 \ub77c\uc774\ube0c\ub7ec\ub9ac, \ud3f4\ub354, \ud30c\uc77c\ub3c4 \uc990\uaca8\ucc3e\uae30\uc5d0 \ucd94\uac00\ud558\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \uc990\uaca8\ucc3e\uae30 \ud56d\ubaa9\uc740 \uc8fc\ub85c \uc790\uc8fc \uc0ac\uc6a9\ud558\ub294 \ud56d\ubaa9\uc5d0 \uac04\ud3b8\ud558\uac8c \uc811\uadfc\ud560 \uc218 \uc788\uac8c \ud574\uc90d\ub2c8\ub2e4. \ub77c\uc774\ube0c\ub7ec\ub9ac, \ud3f4\ub354, \ud30c\uc77c\uc758 \uc67c\ud3b8\uc5d0 \uc788\ub294 \ubcc4\ud45c \ud45c\uc2dc\ub97c \ub20c\ub7ec \uc990\uaca8\ucc3e\uae30\uc5d0 \ucd94\uac00\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You have not created any libraries yet. A library is a container to organize your files and folders. A library can also be shared with others and synced to your connected devices. You can create a library by clicking the \"New Library\" button in the menu bar.": "\uc544\uc9c1 \ub9cc\ub4e0 \ub77c\uc774\ube0c\ub7ec\ub9ac\uac00 \uc5c6\uc2b5\ub2c8\ub2e4. \ub77c\uc774\ube0c\ub7ec\ub9ac\ub294 \ud30c\uc77c \ubc0f \ud3f4\ub354\ub97c \ubaa8\uc544\ub450\ub294 \ucee8\ud14c\uc774\ub108\uc785\ub2c8\ub2e4. \ub610\ud55c \ub77c\uc774\ube0c\ub7ec\ub9ac\ub294 \ub2e4\ub978 \uc0ac\uc6a9\uc790\uc5d0\uac8c \uacf5\uc720\ud560 \uc218 \uc788\uc73c\uba70 \uc5f0\uacb0\ud55c \uc7a5\uce58\uc640 \ub3d9\uae30\ud654\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uba54\ub274 \ud45c\uc2dc\uc904\uc758 \"\uc0c8 \ub77c\uc774\ube0c\ub7ec\ub9ac\" \ub2e8\ucd94\ub97c \ub20c\ub7ec \ub77c\uc774\ube0c\ub7ec\ub9ac\ub97c \uc0c8\ub85c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You have not created any share links yet. A share link can be used to share files and folders with anyone. You can create a share link for a file or folder by clicking the share icon to the right of its name.": "\uc544\uc9c1 \uc5b4\ub5a4 \uacf5\uc720 \ub9c1\ud06c\ub3c4 \ub9cc\ub4e4\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \uacf5\uc720 \ub9c1\ud06c\ub294 \ub2e4\ub978 \uc5b4\ub5a4 \ub204\uad70\uac00\uc640 \ud30c\uc77c \ubc0f \ud3f4\ub354\ub97c \uacf5\uc720\ud560 \ub54c \ud65c\uc6a9\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \ud30c\uc77c \ub610\ub294 \ud3f4\ub354 \uc774\ub984 \uc624\ub978\ud3b8\uc5d0 \uc788\ub294 \uacf5\uc720 \uc544\uc774\ucf58\uc744 \ub20c\ub7ec \ud30c\uc77c \ub610\ub294 \ud3f4\ub354\ub97c \uacf5\uc720\ud558\ub294 \ub9c1\ud06c\ub97c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You have not created any upload links yet. An upload link allows anyone to upload files to a folder or library. You can create an upload link for a folder or library by clicking the share icon to the right of its name.": "\uc544\uc9c1 \uc5b4\ub5a4 \uc5c5\ub85c\ub4dc \ub9c1\ud06c\ub3c4 \ub9cc\ub4e4\uc9c0 \uc54a\uc558\uc2b5\ub2c8\ub2e4. \uc5c5\ub85c\ub4dc \ub9c1\ud06c\ub294 \ub204\uad70\uac00\uc5d0\uac8c \ud3f4\ub354 \ub610\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac\uc5d0 \ud30c\uc77c\uc744 \uc5c5\ub85c\ub4dc\ud558\uac8c\ub054 \ud574\uc90d\ub2c8\ub2e4. \ud3f4\ub354 \ub610\ub294 \ub77c\uc774\ube0c\ub7ec\ub9ac \uc774\ub984\uc758 \uc624\ub978\ud3b8\uc5d0 \uc788\ub294 \uacf5\uc720 \uc544\uc774\ucf58\uc744 \ub20c\ub7ec \ud30c\uc77c\uc744 \uc5c5\ub85c\ub4dc\ud558\ub294 \ub9c1\ud06c\ub97c \ub9cc\ub4e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",
    "You have not deleted any libraries in the last {placeholder} days. A deleted library will be cleaned automatically after this period.": "\ucd5c\uadfc {placeholder}\uc77c\ub3d9\uc548 \uc0ad\uc81c\ud55c \uc5b4\ub5a4 \ub77c\uc774\ube0c\ub7ec\ub9ac\ub3c4 \uc5c6\uc2b5\ub2c8\ub2e4. \uc0ad\uc81c\ud55c \ub77c\uc774\ube0c\ub7ec\ub9ac\ub294 \uc774 \uae30\uac04\uc774 \uc9c0\ub098\uba74 \uc790\ub3d9\uc73c\ub85c \uc9c0\uc6cc\uc9d1\ub2c8\ub2e4.",
